const debug = false

let t=0

let prevSpeed = 1
let speed=1
let score=0

let map_offset=0
let map_row_offset=0

class BoundingBox{
	constructor(x, y, w, h) {
		this.x = x
		this.y = y
		this.w = w
		this.h = h
	}

	top() {
		return this.y
	}

	right() {
		return this.x + this.w - 1
	}

	bottom() {
		return this.y + this.h - 1
	}

	left() {
		return this.x
	}
}

class Player{
	constructor(x, y) {
		this.imageIndex = 256
		this.x = x
		this.y = y
		this.boundingBox = new BoundingBox(x+2, y+8, 12, 6)
	}

	update() {
		if (speed > 0) {
			if (btn(2)) this.x--
			if (btn(3)) this.x++
		}

		this.imageIndex = 256 + ((t%60) / 30 | 0) * 2
		if (speed == 0) this.imageIndex = 256

		this.boundingBox.x = this.x+2
		this.boundingBox.y = this.y+8

		// If flag 0 (crash) is true, then crash.
		if (fget(mget(this.getPlayerMapX(), this.getPlayerMapY()), 0)) {
			speed = 0
		}
	}

	getPlayerMapX() {
		return Math.floor((this.x+8)/8)
	}

	getPlayerMapY() {
		return Math.floor((Math.abs(map_offset)+player.y+8)/8)
	}

	draw() {
		spr(this.imageIndex, this.x, this.y, 0, 1, 0, 0, 2, 2)
		if (debug) rectb(this.boundingBox.x, this.boundingBox.y, this.boundingBox.w, this.boundingBox.h, 8);

		if (debug) {
			print(this.getPlayerMapX(), 0, 0, 8)
			print(this.getPlayerMapY(), 0, 8, 8)
			const mgetVal = mget(this.getPlayerMapX(), this.getPlayerMapY())
			print(mgetVal, 0, 16, 8)
			print(fget(mgetVal, 0), 0, 24, 8)
		}
	}

	/**
	 * @param {BoundingBox} boundingBox
	 * @returns {boolean}
	 */
	checkBoundingBoxCollision(boundingBox) {
		// If player is to the right
		if (this.boundingBox.left() > boundingBox.right()) {
			return false
		}

		// If player is below
		if (this.boundingBox.top() > boundingBox.bottom()) {
			return false
		}

		// If player is to the left
		if (this.boundingBox.right() < boundingBox.left()) {
			return false
		}

		// If player is above
		if (this.boundingBox.bottom() < boundingBox.top()) {
			return false
		}

		return true
	}
}

class Tree{
	constructor(y) {
		this.imageIndex = 260
		this.x = Math.floor(Math.random() * (204 - 20 + 1)) + 20
		this.y = y
		this.boundingBox = new BoundingBox(this.x+4, y+24, 8, 8)
	}

	update() {
		this.y -= speed
		if (this.y < -80) {
			this.x = Math.floor(Math.random() * (204 - 20 + 1)) + 20
			this.y = 300
		}
		this.boundingBox.x = this.x + 4
		this.boundingBox.y = this.y + 24
	}

	draw() {
		spr(this.imageIndex, this.x, this.y, 0, 1, 0, 0, 2, 4)
		if (debug) rectb(this.boundingBox.x, this.boundingBox.y, this.boundingBox.w, this.boundingBox.h, 5);
	}
}

class Coin{
	constructor(x, y) {
		this.imageIndex = 288
		this.x = x
		this.y = y
		this.boundingBox = new BoundingBox(this.x, y, 8, 8)
	}

	update() {
		this.y -= speed
		if (this.y < -80) {
			coins.splice(coins.indexOf(this), 1)
		}
		this.boundingBox.x = this.x
		this.boundingBox.y = this.y
	}

	draw() {
		spr(this.imageIndex, this.x, this.y, 0, 1, 0, 0, 2, 4)
		if (debug) rectb(this.boundingBox.x, this.boundingBox.y, this.boundingBox.w, this.boundingBox.h, 5);
	}
}

